function setCurrentDate(year, month, day, limit, direction)
{		
	if ( (typeof(year) == "string") && (typeof(month) == "boolean") && (typeof(day) == "string") && (typeof(limit) == "number") && (typeof(direction) == "boolean")  )
	{
		var dateObj  = new Date();

		var ab_year 	  = dateObj.getFullYear();
		var ab_month 	  = dateObj.getMonth()+1;
		var ab_month_real = dateObj.getMonth();
		var ab_day 	 	  = dateObj.getDate();

		currentDateUnixTime 	  = moment(new Date(ab_year , ab_month , ab_day)).unix();
		currentDateUnixRealMonth  = moment(new Date(ab_year , ab_month_real , ab_day)).unix();
		currentDateString		  = ab_day+"/"+ab_month+"/"+ab_year;

	}else if( (typeof(year) == "string") && (typeof(month) == "string") && (typeof(day) == "string") && (typeof(limit) == "number") && (typeof(direction) == "string") && (day.length > 0 ) )
	{	
		var ab_month = parseFloat(month)+1 ;

		currentDateUnixTime 	  = moment(new Date(year , ab_month , day)).unix();
		currentDateUnixRealMonth  = moment(new Date(year , month , day)).unix();
		currentDateString		  = day+"/"+ab_month+"/"+year;
	}

	var dashAtSelectedDateEvent    = $("#dashAtSelectedDateEvent");
	var dashAtSelectedEvent 	   = $("#dashAtSelectedEvent");
	var eventCalendarEventShow     = $("#eventCalendarEventShow");
	var attendanceEventDescription = $("#attendanceEventDescription");

	dashAtSelectedDateEvent.hide();
	dashAtSelectedEvent.empty();

	var moment_date_notation 			= ab_moment_plus(currentDateUnixRealMonth);
	var dashAtSelectedDateEventContent  = "<span class='lead'>"+currentDateString+"</span>"+" ( "+moment_date_notation+" )";
	dashAtSelectedDateEvent.html(dashAtSelectedDateEventContent);
	dashAtSelectedDateEvent.slideDown();

	eventCalendarEventShow.hide();
	attendanceEventDescription.hide();

	$("#dashboardAtSelectEvent").select2("val", "");
	$("#dashboardAtSelectSubject").select2("val", "");
	$("#dashboardAtselectClassroom").select2("val", "");
		
}

